正規輸入品 普通車用サマータイヤ<br><br>
【商品について】<br>
・新品タイヤ１本価格（税込）です。<br><br>
【送料について】<br>
ご注文2本以上で送料無料！<br>
※1本の場合は\1,080の送料がかかります。（受注確認後、金額修正してメールにてお知らせ致します。）<br>
※北海道は1本につき別途\1,000、沖縄本島は1本につき別途\4,000が必要になります。（受注確認後、金額修正してメールにてお知らせ致します。）<br>
※各県の離島への発送は実費が必要となりますので、事前にお問い合わせをお願いします。<br><br>
【納期について】<br>
・出荷は目安でご注文より2～3営業日です。<br>
・お急ぎの方はご注文前に在庫・納期の確認をお願いします。<br>
・メーカー欠品や生産待ちなどで商品がすぐにご用意できない場合は、代替品をご案内させて頂くかご注文のキャンセルをお願いする事があります。<br><br>
