Winterパフォーマンスを発揮する技術投入に加え、構造強化などによりドライ性能を引き上げました。氷雪路での優れた走破性とドライ路面での快適性を両立したICE NAVI SUVは、あらゆるシーンで上質なドライビングフィールを提供。グッドイヤーの厳しい自社基準をクリアした「エコグレード」商品です。<br><br>ICE NAVI SUV専用の方向性なし、対称パターンを採用。大型ブロック基調から、乗用車用スタッドレス ICE NAVI 6の系統を引き継ぎつつ、センターブロックにSUVらしい力強さを表現しました。路面への接地形状を最適化（拡大）することにより、雪上グリップUPに貢献し、雪上制動、雪上操縦安定性能が向上しています。<br><br>※販売価格はタイヤ1本の価格です。ホイールは付属しておりません。ホイールは装着イメージです。<br><br><br>タイヤサイズ：285/60R18(285/60-18)<br><br>汎用パーツ | 汎用パーツ | 全て<br>スタッドレスタイヤ | スタッドレス/18インチ<tr><td colspan="2">
