冬道の走りに求められてきた「氷雪路での力強い走り」「ライフの長さ」そして「ドライ・ウエット路でのシャープなハンドリング」といった３つの要素を高次元の領域まで進化させた新技術を搭載。グッドイヤーの厳しい自社基準をクリアした「エコグレード」商品です。<br><br>アクアフィラー（カップリング剤）と撥水シリカにより、ウェット路面への密着度を高め、ウェットグリップ性能が向上。アドバンスコンパウンドと高剛性ベースコンパウンドがタイヤ全体の剛性を高め、ハンドリング、操縦安定性を向上させ、オーバーレイヤーとエッジレイヤーがトレッド部の剛性を高め、安定した直進、コーナリング性能を実現しました。<br><br>※販売価格はタイヤ1本の価格です。ホイールは装着イメージです。<br><br><br>タイヤサイズ：235/45R18(235/45-18)<br><br>汎用パーツ | 汎用パーツ | 全て<br>スタッドレスタイヤ | スタッドレス/18インチ<tr><td colspan="2">
