従来のレボ発泡ゴムZに新素材を配合し、摩耗時に発泡ゴム内の気泡や水路が連結することで、すべりの原因となる氷上の水の膜を取り除く除水効果をさらに高め、氷上性能を向上。路面状況や走行シーンによって変化するトレッドパタンの内側・外側それぞれの役割を適正化し、様々な冬道での性能を向上。<br><br>「Playz（プレイズ）」や「-EGNO（レグノ）」に採用の非対称形状を「ブリザック」にはじめて採用し、タイヤやクルマのふらつきをおさえ直進安定性を向上。タイヤの接地幅をスリム化し、路面上の雪や水などから受ける抵抗を低減することで、雪路やシャーベット路、ウェット路での性能を向上。同時に接地長のロング化により従来品「BLIZZAK　REVO2」同等の接地面積を確保。氷上性能に影響無く、上記性能向上を実現。<br><br>※販売価格はタイヤ1本の価格です。ホイールは装着イメージです。この商品につきましては配達時間のご指定はできません。<br><br><br>タイヤサイズ：235/50R18 (235/50-18)<br><br>汎用パーツ | 汎用パーツ | 全て<br>スタッドレスタイヤ | スタッドレス/18インチ<tr><td colspan="2">
